unsigned short getTvCommand(unsigned char *data,unsigned short id,unsigned short fun)
{
	unsigned short crc = 0;
	unsigned short i = 0;
	data[0] = 0x30;
	data[1] = 0x00;
	data[2] = tv_table[id]->format_index;
	data[3] = tv_table[id]->keytable[(fun - 1) * 2];
	data[4] = tv_table[id]->keytable[(fun - 1) * 2 + 1];
	data[5] = tv_table[id]->custome_code[0];
	data[6] = tv_table[id]->custome_code[1];
	data[7] = tv_table[id]->custome_code[2];
	data[8] = tv_table[id]->custome_code[3];
	if(data[2] == 0x04)// 
	{
		data[5] ^= 0x20;// 
	}
	else if(data[2] == 0x0a)
	{
		data[5] ^= 0x08;//  
	}	
	crc = 0;
	for(i=0;i<10;i++)
	{
		crc = data[i]+crc;
	}
	data[9] = crc&0xff;
	return 10;
}














